pragma solidity >=0.4.22 <0.7.0;


interface TokenToExchange  {
    function transfer(address _to, uint256 _value) external returns (bool success);
}

interface TokenProxyToExchange  {
    function transferFromProxy(address recipient, uint256 amount) external returns (bool);
}


contract Exchange {
    TokenToExchange token;
    TokenProxyToExchange tokenproxy;

    address owner;
    uint24 price;

    constructor(address elt, address proxy) public 
    {
       owner = msg.sender;
       price = 50000; //1eth=50000lark
       token = TokenToExchange(elt);
       tokenproxy = TokenProxyToExchange(proxy);
    }

    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }

    //给合约转以太币以换取代币
    receive() external 
        payable 
    { 
        token.transfer(msg.sender, msg.value * price);
    }

    function larkToEth(uint _amount) 
        public
        payable
    {
        tokenproxy.transferFromProxy(address(this), _amount);
        msg.sender.transfer(_amount / price);
    }

    function setPrice(uint24 _price)
        public
        onlyOwner
    {
        price = _price;
    }

    function getThis() 
        public
        view
        returns(address)
    {
        return address(this);
    }

    function getMessage()
        public
        view
        returns(address, uint)
    {
        return (owner, price);
    }

    function withdrawLark(uint _amount)
        public
        onlyOwner
    {
        token.transfer(msg.sender, _amount);
    }

}
